import React from 'react'
import Data from './colleges.json'
const Card=()=> {
    return (
      <div className="App">
       
          { Data.colleges.map((post) => {
            return (
              <>
                <h1>{post.discount}</h1>
                <h1>{post.college_name}</h1>
              </>
            )
          })}
        </div>
    
    );
  }
  
export default Card
